ready(()=>{const e=new IntersectionObserver(function(e){e.map(e=>{if(e.isIntersecting){for(var t=[],r=0;r<e.target.classList.length;r++){var s=e.target.classList[r];0===s.indexOf("enter:")&&t.push(s)}for(r=0;r<t.length;r++)e.target.classList.remove(t[r])}})},{threshold:.1});document.querySelectorAll('[class*="enter:"]').forEach(t=>{e.observe(t)})});